css:
#jasmine_content {
  position: fixed;
  right: 100%;
}
body {
  background-color: #fff;
  padding: 0;
}
.spec-reporter {
  font-size: 11px;
  line-height: 1.6em;
  color: #333;
}
.spec-reporter .list-unstyled {
  list-style: none;
}
.spec-reporter .symbol-header {
  font-size: 18px;
  font-weight: bold;
  padding-bottom: 10px;
}
.spec-reporter .symbol-area {
  padding: 10px;
}
.spec-reporter .symbol-summary {
  overflow: hidden;
  margin: 0;
}
.spec-reporter .symbol-summary li {
  font-family: Monaco, Consolas, monospace;
  float: left;
  line-height: 10px;
  height: 10px;
  width: 10px;
  font-size: 10px;
}
.spec-reporter .symbol-summary li.passed {
  color: #5cb85c;
}
.spec-reporter .symbol-summary li.failed {
  color: #d9534f;
}
.spec-reporter .symbol-summary li.skipped {
  color: #f0ad4e;
}
.spec-reporter .symbol-summary li.pending {
  color: #eee;
}
.spec-reporter .symbol-summary li:before {
  content: "\02022";
}
.spec-reporter .status {
  font-size: 20px;
  line-height: 2em;
  padding: 5px;
  border-radius: 0;
  text-align: center;
}
.spec-reporter .status .spec-count {
  float: left;
}
.spec-reporter .status .time {
  float: right;
}
.spec-reporter .results {
  padding: 10px;
}
.spec-reporter .results .description {
  font-size: 16px;
  padding: 5px 0 5px 0;
}
.spec-reporter .results > .suite {
  margin-bottom: 20px;
}
.spec-reporter .results > .suite > .description {
  font-size: 18px;
  font-weight: bold;
}
.spec-reporter .results .spec {
  margin-top: 5px;
  padding: 0 10px 10px 10px;
  border-left: 3px solid #d9534f;
}
.spec-reporter .results .spec .spec-toggle {
  float: right;
  cursor: pointer;
  opacity: 0;
  color: #999;
}
.spec-reporter .results .spec .spec-toggle:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f0cc";
}
.spec-reporter .results .spec .spec-toggle.folded:before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f039";
}
.spec-reporter .results .spec .spec-toggle:hover {
  color: #333;
}
.spec-reporter .results .spec:hover .spec-toggle {
  opacity: 1;
}
.spec-reporter .results .suite > .suite,
.spec-reporter .results .suite > .spec {
  margin-left: 10px;
}
.spec-reporter .result-message {
  font-size: 16px;
  font-weight: bold;
  color: #d9534f;
  padding: 5px 0 5px 0;
}
.spec-reporter .stack-trace {
  font-size: 12px;
  margin: 5px 0 0 0;
  border-radius: 2px;
  line-height: 18px;
  color: #666;
  border: 1px solid #ddd;
  overflow: auto;
}
.spec-reporter .tooltip .tooltip-inner {
  border: 1px solid #ccc;
  background: #fff;
  color: #666;
  max-width: 400px;
}
.spec-reporter .tooltip.in {
  opacity: 1;
}
.spec-reporter .tooltip .tooltip-arrow {
  visibility: hidden;
}
